import React from 'react';
import {NavLink} from 'react-router-dom';
import {connect} from 'react-redux';
import {signOut} from '../../../store/actions/authActions';
import {
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
  MDBNavItem,
  MDBNavLink,
  MDBNavbarToggler,
  MDBCollapse,
  MDBDropdown,
  MDBDropdownToggle,
  MDBDropdownMenu,
  MDBDropdownItem,
  MDBIcon,
} from 'mdbreact';
const LogIn = () => {
  return (
    <>
      <MDBNavItem>
        <MDBNavLink to='/create'>New List</MDBNavLink>
      </MDBNavItem>
    </>
  );
};

export default LogIn;
